import React from 'react';
import { Navigate } from "react-router-dom";

const ProtectedRouteElement = ({ loggedIn }) => {
    return (
      loggedIn ? <Navigate to='/' /> : <Navigate to="/sign-in" replace/>
  )}

  export default ProtectedRouteElement;
